description:
Hot cars and cold bodies tossed a terrific headache onto the hard-working manhunters of the homicide squad. Fingerprint files and rogues gallery photos were searched in vain, but Molly O'Day, super sleuth policewoman, spotted a clue that led her to a midnight date with death!

